let solution = function (A) {

    const sumReduce = function (acc, cur) {
        return acc + cur;
    };

    let sumA = A.slice( 0, 1 ).reduce(sumReduce);
    let sumB = A.slice( 1 ).reduce(sumReduce);
    let diff = Math.abs(sumA - sumB);
    let min = diff;
    for ( let j = 1; j <= A.length -2; j++ ) {
        sumA += A[j];
        sumB -= A[j];
        diff = Math.abs(sumA - sumB);
        min = diff < min ? diff : min;
    }

    return min;
};

